import React from "react";
import { Logout } from "./Logout";
import { LoginResponse } from "./Login";
import { useLocation } from "react-router-dom";

export const MainPage = () => {
  const location = useLocation();

  // Access loginResponse from location.state
  const loginResponse: LoginResponse = location.state?.loginResponse || {
    message: "",
    passwordMatch: false,
    changePassword: "",
  };

  console.log("MainPage received loginResponse:", loginResponse);

  return (
    <>
      <Logout
        changePassword={loginResponse.changePassword}
        message={loginResponse.message}
        passwordMatch={loginResponse.passwordMatch}
      />
    </>
  );
};
